import React, {useState,useEffect} from 'react';
import {BrowserRouter as Router, Switch, Route, Link} from "react-router-dom";
import '../css/App.css';
import Registrar from './Registrar';
import Loggin  from './Loggin';

export default function Navegation(){
    const [path, setstate] = useState("/")
    useEffect(() => {
        if (path==="/Loggin"){
            console.log("loggin")
        }
        console.log("registrar")
    })

    return (
            <Router>
                <div class="Menu">
                    <Link to={path}><button onClick={()=>setstate("/Loggin")}>Ingresar</button></Link>
                    <Link to={path}><button onClick={()=>setstate("/")}>Registrarse</button></Link>
                </div>
                <div className="Title">
                    <h1>Presupuesto Personal</h1>
                </div>
                <div class="Contenido">    
                <Switch>
                    <Route path={path}><Registrar/></Route>
                    <Route path={path}><Loggin/></Route>
                </Switch>
                </div>  
            </Router>
    )
}
